syntax = "proto3";

package gaiaProto;

option go_package = ".;gaiaProto";

//--------------------通用區塊 common---------------------

// Request Method
message GaiaResponse {
  int32 type = 1;
  int32 ret = 2;
  string token = 3;
  string msg = 4;
  bytes data = 5;
}

message Card {
  int32 GameID = 1;
  int32 Level = 2;
  int32 CardIndex = 3;
  int32 Star = 4;
  int32 Count = 5;
}

message Mission {
  uint32 ItemID = 1;
  uint32 ItemCount = 2;
  int64 ExtendID = 3;
}

message ServiceData {
  uint32 missionReward = 1;
  int32 jpType = 2;
  double jpWin = 3;
  double fullJpWin = 4;
  int32 trialfinish = 5;
  int32 trialaward = 6;
  int32 freeremain = 7;
  repeated Card cardlist = 8;
  double buffmul = 9;
  double buffmulwin = 10;
  int32 buffexbet = 11;
  int32 bufffree = 12;
  repeated Mission missionlist = 13;
  string ErrorMsg = 14;
}

//--------------------碎片系統 debris---------------------

message DebrisAInfoReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
  int32 lang = 4;
}

message DebrisPInfoReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
  int32 ano = 4;
}

message DebrisPGetReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

message DebrisExchangeReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
  int32 ano = 4;
  int32 fno = 5;
  int32 amount = 6;
}

//--------------------滿額必開 fulljp---------------------

//---------------
// req

message FullJPInfoReq {
  int32 aid = 1;
  string token = 2;
}

message FullJPInfoAllReq {
  int32 aid = 1;
  string token = 2;
}

message FullJPHistoryReq {
  int32 aid = 1;
  string token = 2;
}

//---------------
// ack

message FullJPInfoAck {
  double value = 1;
  double full = 2;
  int32 minvip = 3;
  double minbet = 4;
}

message FullJPInfoAllAck {
  int32 acktype = 1;
  repeated FullJPList list = 2;
}

message FullJPList {
  int32 apiid = 1;
  int32 gameid = 2;
  double value = 3;
  double full = 4;
}

message FullJPHistoryAck {
  repeated FullJPHistoryData list = 1;
}

message FullJPHistoryData {
  string winner = 1;
  string nickname = 2;
  double win = 3;
  int32 time = 4;
}

//--------------------道具系統 item---------------------

message ItemListReq {
  int32 aid = 1;
  string token = 2;
  int32 lang = 3;
  int32 currencynumber = 4;
}

message ItemAllGameReq {
  int32 aid = 1;
  string token = 2;
  int32 lang = 3;
  int32 currencynumber = 4;
}

message ItemUseCardReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
  string itemindex = 4;
  string itemid = 5;
  string amount = 6;
}

message ItemCheckNewReq {
  int32 aid = 1;
  string token = 2;
}

message ItemGetMailReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

message ItemSetReadReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

//--------------------任務系統 mission---------------------

message MissionDailyReq {
  int32 aid = 1;
  string token = 2;
  string lang = 3;
  int32 currencynumber = 4;
  bool isNow = 5;
  int32 level = 6;
}

//--------------------重播系統 replay---------------------

//---------------
// req

message ReplayListReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

message ReplayGetReq {
  int32 aid = 1;
  string token = 2;
  string index = 3;
}

message ReplayCheckReq {
  int32 aid = 1;
  string token = 2;
}

//---------------
// ack

message ReplayListAck {
  int32 acktype = 1;
  repeated ReplayLDF list = 2;
}

message ReplayLDF {
  repeated ReplayLClient row = 1;
}

message ReplayLClient {
  int32 aid = 1;
  string account = 2;
  string name = 3;
  double bet = 4;
  double win = 5;
  double odd = 6;
  double adjustwin = 7;
  int32 currency = 8;
  string currsymbol = 9;
  double currunit = 10;
  string time = 11;
  string index = 12;
}

message ReplayGetAck {
  int32 acktype = 1;
  string ack = 2;
}

message ReplayCheckAck {
  int32 acktype = 1;
  bool needinit = 2;
}

//--------------------免費贈金 trial---------------------

//---------------
// req

message TrialInfoReq {
  int32 aid = 1;
  string token = 2;
  int32 vip = 3;
  int32 lang = 4;
}

message TrialSignUpReq {
  int32 aid = 1;
  string token = 2;
  int32 vip = 3;
  int32 actno = 4;
}

message TrialGiveUpReq {
  int32 aid = 1;
  string token = 2;
  int32 actno = 3;
}

//---------------
// ack

message TrialInfoAck {
  int32 acktype = 1;
  int32 nowactno = 2;
  int32 targettype = 3;
  repeated TrialAward awarddesc = 4;
  int32 pstate = 5;
  TrialPData trialinfo = 6;
  repeated double bet = 7;
  bool remind = 8;
  TrialAward remindinfo = 9;
  repeated int32 rtags = 10;
  string start = 11;
  string end = 12;
}

message TrialAward {
  int32 award = 1;
  int32 type = 2;
  double gate = 3;
  int32 gameid = 4;
  int32 itemid = 5;
  int32 amount = 6;
  TrialItem data = 7;
  double money = 8;
}

message TrialItem {
  int32 star = 1;
  int32 icon = 2;
  int32 type = 3;
  double bet = 4;
  string gamename = 5;
}

message TrialPData {
  int32 apiid = 1;
  int32 gameid = 2;
  int32 sac = 3;
  int32 activityno = 4;
  double totalbet = 5;
  double totalwin = 6;
  double property = 7;
}

message TrialSignUpAck {
  int32 acktype = 1;
  TrialPData trialinfo = 2;
}

message TrialGiveUpAck {
  int32 acktype = 1;
  int32 award = 2;
}

//--------------------聯合彩金 unionjp---------------------

//---------------
// req

message UnionJPInfoReq {
  int32 aid = 1;
  string token = 2;
}

message UnionJPInfoAllReq {
  int32 aid = 1;
  string token = 2;
}

message UnionJPHistoryReq {
  int32 aid = 1;
  string token = 2;
}

message UnionJPBlockReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

//---------------
// ack

message UnionJPInfoAck {
  repeated UnionJPPool list = 1;
}

message UnionJPPool {
  int32 type = 1;
  double value = 2;
}

message UnionJPInfoAllAck {
  repeated UnionJPPool plist = 1;
  repeated int32 glist = 2;
}

message UnionJPHistoryAck {
  repeated UnionJPHistoryData list = 1;
}

message UnionJPHistoryData {
  int32 type = 1;
  string winner = 2;
  string nickname = 3;
  double win = 4;
  int32 gameID = 5;
}

message UnionJPBlockAck {
  repeated double list = 1;
}

//--------------------vip簽到 vipsignup---------------------

//---------------
// req

message VipSignInfoReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

message VipSignRewardReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
  string index = 4;
}

//---------------
// ack

message VipSignInfoAck {
  VipSignInfoData info = 1;
  int32 result = 2;
}

message VipSignInfoData {
  repeated VipSignTreasure treasurelist = 1;
  string expiredtime = 2;
  int32 error = 3;
}

message VipSignTreasure {
  string index = 1;
  int32 minvip = 2;
  double exp = 3;
  bool isopen = 4;
}

message VipSignRewardAck {
  VipSignRewardData info = 1;
  int32 result = 2;
}

message VipSignRewardData {
  int32 itemid = 1;
  int32 count = 2;
  int32 error = 3;
  int32 icon = 4;
}

//--------------------購買FG mall---------------------

//---------------
// req

message CheckMallReq {
  int32 aid = 1;
  string token = 2;
  int32 apiid = 3;
  bool isvol = 4;
  int32 voltype = 5;
}

//---------------
// ack

message CheckMallAck {
  repeated GameMallSetting Settings = 1;
  int32 Show = 2;
}

message GameMallSetting {
  int32 GameID = 1;
  int32 APIID = 2;
  int32 AlterID = 3;
  int32 DescType = 4;
  int32 DescRounds = 5;
  double MaxBet = 6;
  double PriceOdd = 7;
  bool ForSale = 8;
  repeated double BetVec = 9;
  int32 ReelNo = 10;
  int32 BetNo = 11;
  bool Event = 12;
}

//--------------------app等級系統 level---------------------

message LevelReq {
  int32 aid = 1;
  string token = 2;
  int32 currencynumber = 3;
}

//--------------------buff系統 Buff---------------------

message BuffBackReq {
  int32 aid = 1;
  string token = 2;
  int32 apiid = 3;
  int32 lang = 4;
}

message BuffNowReq {
  int32 aid = 1;
  string token = 2;
  int32 apiid = 3;
  int32 gameid = 4;
}

message BuffUseReq {
  int32 aid = 1;
  string token = 2;
  int32 apiid = 3;
  int32 gameid = 4;
  int64 buffidx = 5;
  int64 buffid = 6;
  int32 currency = 7;
}

message BuffParamReq {
  int32 aid = 1;
  string token = 2;
  repeated int64 idlist = 3;
}

//--------------------Gift Code---------------------

//---------------
// req

message VerifyGiftCodeReq {
  int32 aid = 1;
  string token = 2;
  int32 apiid = 3;
  string giftcode = 4;
}

message CheckBlockGiftCodeReq {
  int32 aid = 1;
  string token = 2;
}

//---------------
// ack

message VerifyGiftCodeAck {
  int32 Code = 1;
  int32 Type = 2;
  int32 Round = 3;
}

message CheckBlockGiftCodeAck {
  int32 Code = 1;
  string Message = 2;
  bool IsBlock = 3;
  int32 BlockDuration = 4;
  int32 ErrorInputAmount = 5;
}

